  \"Rocky Mountain Arsenal National Wildlife Refuge : Annual narrative report : Fiscal
  year 2003\",\n\t\"tracking_summary\": {\n\t\t\"total\": 0,\n\t\t\"recent\": 0\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-08-30T12:25:00.570245\",\n\t\"name\":
  \"rocky-mountain-arsenal-national-wildlife-refuge-annual-narrative-report-fiscal-year-2003\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Rocky
  Mountain Arsenal  outlines activities and accomplishments during the 2003 fiscal
  year. The report begins with an introduction to the Refuge. Highlights and weather
  conditions are summarized for the year. Information about monitoring and studies-
  including surveys and censuses- is provided next. Habitat restoration and management
  projects are also covered; activities include wetland restoration, upland restoration,
  riverine restoration, water level management, moist soil management, grazing/mowing/haying,
  farming, forest management, fire management, and vegetation control. Fish and wildlife
  management are discussed next with emphasis on bird banding, disease monitoring,
  reintroductions, nest structures, and animal control. Coordination activities, such
  as interagency coordination and cooperative organizations, are outlined. The resource
  protection section provides an update on contaminants, water rights, and land acquisition
  support. Information about public education and recreation is given including visitor
  services. Finally, comprehensive management planning is discussed in the Refuge
  planning and administration section\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
